;; gorilla-repl.fileformat = 1

;; **
;;; # Matching triangle, and other shapes
;;; 
;;; In this recipe you learn how to match shapes with each others. Matching shapes can be used to count thing automatically.
;; **

;; @@
(ns stark-spring
 (:require
   [opencv4.utils :as u]
[opencv4.gorilla :as g]
   [opencv4.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def t1 
  (->
  "resources/white-blue-triangle.png"
  (imread)
  (u/resize-by 0.2) ))

(g/>> t1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"165\" height=\"165\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2792993a \"BufferedImage@2792993a: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7d9bc538 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 165 height = 165 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@

(def t2
  (->
   "resources/Sweden_road_sign_A19-1.svg.png"
   (imread)
   (u/resize-by 0.7) ))

(g/>> t2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"154\" height=\"136\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x20b4a05c \"BufferedImage@20b4a05c: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7d9bc538 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 154 height = 136 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def lower-red  (new-scalar 70 20 20))
(def upper-red  (new-scalar 100 255 255))
(def mask (new-mat))
(in-range (-> t2 clone (cvt-color! COLOR_RGB2HSV)) lower-red upper-red mask)
(g/>> mask)

;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"154\" height=\"136\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1e2af954 \"BufferedImage@1e2af954: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@24206dee transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 154 height = 136 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@

(def contours (new-arraylist))
(find-contours mask contours (new-mat) RETR_LIST CHAIN_APPROX_SIMPLE)

(def indexed  
    (apply hash-map (flatten (map-indexed (fn [idx itm] [idx itm]) contours ))))

(def sorted  
    (into 
      (sorted-map-by 
      (fn [key1 key2]
       (clojure.core/compare  
        (-> (get indexed key1) (.size) (.area))
        (-> (get indexed key2) (.size) (.area))))) 
                   indexed))

(def biggest (last sorted))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stark-spring/biggest</span>","value":"#'stark-spring/biggest"}
;; <=

;; @@
(def output 
  (new-mat (.rows mask) (.cols mask) CV_8UC1 (new-scalar 0 0 0)))

(draw-contours output contours (key biggest)  (new-scalar 255 255 255) FILLED)

(g/>> output)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"154\" height=\"136\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1dad741c \"BufferedImage@1dad741c: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@24206dee transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 154 height = 136 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def s1 
  (-> t1 clone (cvt-color! COLOR_BGR2GRAY) (threshold! 210 240 1)))
(g/>> s1)

(def s2 
  (-> output clone))

(match-shapes 
  (.t s1) 
  (.t s2) CV_CONTOURS_MATCH_I1 0)
